DROP TABLE IF EXISTS `quotes`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `quotes` (
  `quote_id` int NOT NULL AUTO_INCREMENT,
  `customer_name` varchar(100) NOT NULL,
  `book_title` varchar(200) NOT NULL,
  `book_price` decimal(10,2) NOT NULL,
  `profit_percent` decimal(5,2) NOT NULL DEFAULT '30.00',
  `profit` decimal(10,2) NOT NULL,
  `shipping_cost` decimal(10,2) NOT NULL,
  `shipping_adjustment_jpy` int DEFAULT '0',
  `total_brl` decimal(10,2) NOT NULL,
  `total_jpy` int NOT NULL,
  `exchange_rate` decimal(10,4) NOT NULL,
  `rate_source` varchar(50) NOT NULL,
  `status` enum('pending','approved','rejected') DEFAULT 'pending',
  `admin_id` int DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`quote_id`),
  KEY `admin_id` (`admin_id`),
  CONSTRAINT `quotes_ibfk_1` FOREIGN KEY (`admin_id`) REFERENCES `login` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=272 DEFAULT CHARSET=utf8mb3;
